import 'dart:convert';

import 'data.dart';

class RequestDetailsResponse {
	String? message;
	Data? data;

	RequestDetailsResponse({this.message, this.data});

	factory RequestDetailsResponse.from(Map<String, dynamic> data) {
		return RequestDetailsResponse(
			message: data['message'] as String?,
			data: data['data'] == null
						? null
						: Data.(data['data'] as Map<String, dynamic>),
		);
	}



	Map<String, dynamic> () {
		return {
			'message': message,
			'data': data?.(),		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [RequestDetailsResponse].
	factory RequestDetailsResponse.fromJson(String data) {
		return RequestDetailsResponse.from(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [RequestDetailsResponse] to a JSON string.
	String toJson() => json.encode(());
}
